x<\/td> <td>Description<\/td> <\/tr> <\/thead> <tr> <td>\\neg &lt;sentence&gt;<\/td> <td>Negation (NOT)<\/td> <\/tr> <tr> <td>\\box &lt;sentence&gt;<\/td> <td>Box-Operator (Necessity-Operator)<\/td> <\/tr> <tr> <td>\\diamond &lt;sentence&gt;<\/td> <td>Diamond-Operator (Possibility-Operator)<\/td> <\/tr> <\/table> <h1>Sentences with Quantifications<\/h1> <table id='tableid'> <thead> <tr> <td>Syntax<\/td> <td>Description<\/td> <\/tr> <\/thead> <tr> <td>\\exists &lt;var&gt; &lt;sentence&gt;<\/td> <td>Existence Quantifier<\/td> <\/tr> <tr> <td>\\forall &lt;var&gt; &lt;sentence&gt;<\/td> <td>Universal Quantifier<\/td> <\/tr> <\/table> <h1>Terms &lt;term&gt; <\/h1> <table id='tableid'> <thead> <tr> <td>Syntax<\/td> <td>Description<\/td> <\/tr> <\/thead> <tr> <td><ul> <li>x, x_1, x_2, ... <\/li> <li>y, y_1, y_2, ...<\/li> <li>z, z_1, z_2, ...<\/li><\/ul><\/td> <td>Variables &lt;var&gt; <\/td> <\/tr> <tr> <td><ul><li>a, a_1, a_2, ...<\/li><\/ul><\/td> <td>Constants &lt;const&gt; <\/td> <\/tr> <tr> <td><ul> <li>f^1( &gt;&lt;term&gt; )<\/li> <li>f^1_1( &lt;term&gt; )<\/li> <li>f^1_2( &lt;term&gt; ) ...<\/li> <li>f^2( &lt;term&gt; , &lt;term&gt; )<\/li> <li>f^2_1( &lt;term&gt; , &lt;term&gt; ) ...<\/li> <li>f^3( &lt;term&gt; , &lt;term&gt; , &lt;term&gt; ), ...<\/li> <\/ul><\/td> <td>Function &lt;func&gt; <i>- parsing only - evaluation not yet supported<\/i><\/td> <\/tr> <\/table> <h1>Predicates &lt;pred&gt; <\/h1> <table id='tableid'> <thead> <tr> <td>Syntax<\/td> <td>Description<\/td> <\/tr> <\/thead> <tr> <td width='45%'> <ul> <li>PRED^1( &lt;term&gt; )<\/li> <li>PRED^1_1( &lt;term&gt; )<\/li> <li>RED^1( &lt;term&gt; )<\/li> <li>BEAUTIFUL^1( &lt;term&gt; )<\/li> <li>PRED^2( &lt;term&gt; , &lt;term&gt; )<\/li> <li>SMALLERTHAN^2( &lt;term&gt;, &lt;term&gt; )<\/li> <\/ul> <\/td> <td>PRED, RED, BEAUTIFUL, ... are names of predicates --- <i>only UPPERCASE letters allowed<\/i><br><br> <b>^n<\/b> expresses the arity n of a predicate, i.e. there are n parameters --- <i>Required<\/i
